import React from "react"

function ComponentHome() {
    return(
        <div className="comp">
            <p> We understand that applying as well as finalizing</p>
            <p>on an internship is a hectic task. We are here to </p>
            <p>make internships fun by helping you find the </p>
            <p>perfect internship.</p>
            <br />
        </div>
    )
}

export default ComponentHome
